","short":"Single evidence bit","definition":"The Evidence Resource provides a machine-interpretable expression of an evidence concept including the evidence variables (eg population, exposures/interventions, comparators, outcomes, measured variables, confounding variables), the statistics, and the certainty of this evidence.","min":0,"max":"*","constraint":[{"key":"cnl-0","severity":"warning","human":"Name should be usable as an identifier for the module by machine processing applications such as code generation","expression":"name.exists() implies name.matches('[A-Z]([A-Za-z0-9_]){0,254}')","xpath":"not(exists(f:name/@value)) or matches(f:name/@value, '[A-Z]([A-Za-z0-9_]){0,254}')","source":"http://hl7.org/fhir/StructureDefinition/Evidence"}],"mustSupport":false,"isModifier":false,"mapping":[{"identity":"w5","map":"clinical.general"}]},{"id":"Evidence.url","path":"Evidence.url","short":"Canonical identifier for this evidence, represented as a globally unique URI","definition":"An absolute URI that is used to identify this evidence when it is referenced in a specification, model, design or an instance; also called its canonical identifier. This SHOULD be globally unique and SHOULD be a literal address at which at which an authoritative instance of this summary is (or will be) published. This URL can be the target of a canonical reference. It SHALL remain the same when the summary is stored on different servers.","comment":"Can be a urn:uuid: or a urn:oid: but real http: addresses are preferred. Multiple instances may share the same URL if they have a distinct version.","requirements":"Allows the evidence to be referenced by a single globally unique identifier.","min":0,"max":"1","type":[{"code":"uri"}],"mustSupport":false,"isModifier":false,"isSummary":true,"mapping":[{"identity":"workflow","map":"Definition.url"},{"identity":"w5","map":"FiveWs.identifier"}]},{"id":"Evidence.identifier","path":"Evidence.identifier","short":"Additional identifier for the summary","definition":"A formal identifier that is used to identify this summary when it is represented in other formats, or referenced in a specification, model, design or an instance.","comment":"Typically, this is used for identifiers that can go in an HL7 V3 II (instance identifier) data type, and can then identify this summary outside of FHIR, where it is not possible to use the logical URI.","requirements":"Allows externally provided and/or usable business identifiers to be easily associated with the module.","min":0,"max":"*","type":[{"code":"Identifier"}],"mustSupport":false,"isModifier":false,"isSummary":true,"mapping":[{"identity":"workflow","map":"Definition.identifier"},{"identity":"w5","map":"FiveWs.identifier"},{"identity":"objimpl","map":"no-gen-base"}]},{"id":"Evidence.version","path":"Evidence.version","short":"Business version of this summary","definition":"The identifier that is used to identify this version of the summary when it is referenced in a specification, model, design or instance. This is an arbitrary value managed by the summary author and is not expected to be globally unique. For example, it might be a timestamp (e.g. yyyymmdd) if a managed version is not available. There is also no expectation that versions can be placed in a lexicographical sequence.","comment":"The determination of when to create a new version of a resource (same url, new version) vs. defining a new artifact is up to the author. Considerations for making this decision are found in Technical and Business Versions.","min":0,"max":"1","type":[{"code":"string"}],"mustSupport":false,"isModifier":false,"isSummary":true,"mapping":[{"identity":"workflow","map":"Definition.version"},{"identity":"w5","map":"FiveWs.version"}]},{"id":"Evidence.title","path":"Evidence.title","short":"Name for this summary (human friendly)","definition":"A short, descriptive, user-friendly title for the summary.","comment":"In some cases, the resource can no longer be found at the stated url, but the url itself cannot change. Implementations can use the meta.source element to indicate where the current master source of the resource can be found.","min":0,"max":"1","type":[{"code":"string"}],"mustSupport":false,"isModifier":false,"isSummary":true,"mapping":[{"identity":"workflow","map":"Definition.title"}]},{"id":"Evidence.citeAs[x]","path":"Evidence.citeAs[x]","short":"Citation for this evidence","definition":"Citation Resource or display of suggested citation for this evidence.","min":0,"max":"1","type":[{"code":"Reference","targetProfile":["http://hl7.org/fhir/StructureDefinition/Citation"]},{"code":"markdown"}],"mustSupport":false,"isModifier":false,"isSummary":false},{"id":"Evidence.status","path":"Evidence.status","short":"draft | active | retired | unknown","definition":"The status of this summary. Enables tracking the life-cycle of the content.","comment":"Allows filtering of summarys s that are appropriate for use versus not.","min":1,"max":"1","type":[{"code":"code"}],"mustSupport":false,"isModifier":true,"isModifierReason":"This is labeled as \"Is Modifier\" because applications should not use a retired {{title}} without due consideration","isSummary":true,"binding":{"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-bindingName","valueString":"PublicationStatus"},{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-isCommonBinding","valueBoolean":true}],"strength":"required","description":"The lifecycle status of an artifact.","valueSet":"http://hl7.org/fhir/ValueSet/publication-status|4.3.0"},"mapping":[{"identity":"workflow","map":"Definition.status"},{"identity":"w5","map":"FiveWs.status"}]},{"id":"Evidence.date","path":"Evidence.date","short":"Date last changed","definition":"The date  (and optionally time) when the summary was published. The date must change when the business version changes and it must change if the status code changes. In addition, it should change when the substantive content of the summary 