ate","short":"When the summary was last reviewed","definition":"The date on which the resource content was last reviewed. Review happens periodically after approval but does not change the original approval date.","comment":"If specified, this date follows the original approval date.","requirements":"Gives a sense of how \"current\" the content is.  Resources that have not been reviewed in a long time may have a risk of being less appropriate/relevant.","min":0,"max":"1","type":[{"code":"date"}],"mustSupport":false,"isModifier":false,"isSummary":false,"mapping":[{"identity":"workflow","map":"Definition.lastReviewDate"},{"identity":"objimpl","map":"no-gen-base"}]},{"id":"Evidence.publisher","path":"Evidence.publisher","short":"Name of the publisher (organization or individual)","definition":"The name of the organization or individual that published the evidence.","comment":"Usually an organization but may be an individual. The publisher (or steward) of the evidence is the organization or individual primarily responsible for the maintenance and upkeep of the evidence. This is not necessarily the same individual or organization that developed and initially authored the content. The publisher is the primary point of contact for questions or issues with the evidence. This item SHOULD be populated unless the information is available from context.","requirements":"Helps establish the \"authority/credibility\" of the evidence.  May also allow for contact.","min":0,"max":"1","type":[{"code":"string"}],"mustSupport":false,"isModifier":false,"isSummary":true,"mapping":[{"identity":"workflow","map":"Definition.publisher"},{"identity":"w5","map":"FiveWs.witness"}]},{"id":"Evidence.contact","path":"Evidence.contact","short":"Contact details for the publisher","definition":"Contact details to assist a user in finding and communicating with the publisher.","comment":"Extensions to ContactDetail include: contactReference, contactAddress, and contributionTime (Details at: http://buil