rue},{"id":"Evidence.variableDefinition.intended","path":"Evidence.variableDefinition.intended","short":"Definition of the intended variable related to the Evidence","definition":"Definition of the intended variable related to the Evidence.","min":0,"max":"1","type":[{"code":"Reference","targetProfile":["http://hl7.org/fhir/StructureDefinition/Group","http://hl7.org/fhir/StructureDefinition/EvidenceVariable"]}],"mustSupport":false,"isModifier":false,"isSummary":false},{"id":"Evidence.variableDefinition.directnessMatch","path":"Evidence.variableDefinition.directnessMatch","short":"low | moderate | high | exact","definition":"Indication of quality of match between intended variable to actual variable.","min":0,"max":"1","type":[{"code":"CodeableConcept"}],"mustSupport":false,"isModifier":false,"isSummary":false,"binding":{"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-bindingName","valueString":"EvidenceDirectness"}],"strength":"extensible","description":"The quality of how direct the match is.","valueSet":"http://hl7.org/fhir/ValueSet/directness"}},{"id":"Evidence.synthesisType","path":"Evidence.synthesisType","short":"The method to combine studies","definition":"The method to combine studies.","min":0,"max":"1","type":[{"code":"CodeableConcept"}],"mustSupport":false,"isModifier":false,"isSummary":false,"binding":{"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-bindingName","valueString":"SynthesisType"}],"strength":"extensible","description":"Types of combining results from a body of evidence (eg. summary data meta-analysis).","valueSet":"http://hl7.org/fhir/ValueSet/synthesis-type"}},{"id":"Evidence.studyType","path":"Evidence.studyType","short":"The type of study that produced this evidence","definition":"The type of study that produced this evidence.","min":0,"max":"1","type":[{"code":"CodeableConcept"}],"mustSupport":false,"isModifier":false,"isSummary":false,"binding":{"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-bindingName","valueString":"StudyType"}],"strength":"extensible","description":"The type of study the evidence was derived from.","valueSet":"http://hl7.org/fhir/ValueSet/study-type"}},{"id":"Evidence.statistic","path":"Evidence.statistic","short":"Values and parameters for a single statistic","definition":"Values and parameters for a single statistic.","min":0,"max":"*","type":[{"code":"BackboneElement"}],"mustSupport":false,"isModifier":false,"isSummary":false},{"id":"Evidence.statistic.description","path":"Evidence.statistic.description","short":"Description of content","definition":"A description of the content value of the statistic.","min":0,"max":"1","type":[{"code":"string"}],"mustSupport":false,"isModifier":false,"isSummary":false},{"id":"Evidence.statistic.note","path":"Evidence.statistic.note","short":"Footnotes and/or explanatory notes","definition":"Footnotes and/or explanatory notes.","min":0,"max":"*","type":[{"code":"Annotation"}],"mustSupport":false,"isModifier":false,"isSummary":false},{"id":"Evidence.statistic.statisticType","path":"Evidence.statistic.statisticType","short":"Type of statistic, eg relative risk","definition":"Type of statistic, eg relative risk.","min":0,"max":"1","type":[{"code":"CodeableConcept"}],"mustSupport":false,"isModifier":false,"isSummary":false,"binding":{"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/elementdefinition-bindingName","valueString":"StatisticType"}],"strength":"extensible","valueSet":"http://hl7.org/fhir/ValueSet/statistic-type"}},{"id":"Evidence.statistic.category","path":"Evidence.statistic.category","short":"Associated category for categorical variable","definition":"When the measured variable is handled categorically, the category element is used to define which category the statistic is reporting.","comment":"Simple strings can be used for descriptive purposes. Exact matching to EvidenceVariable.category.name for the Evidence.variableDefini